import React from 'react';
import { useSelector } from 'react-redux';

import {
	selectDataCorona,
	selectIsFetching,
} from '../../redux/data/data.selectors';

import {
	HomeContainer,
	NameContainer,
	NumberContainer,
	TitleContainer,
	TableContainer,
	CountryContainer,
	WrapContainer,
} from './myhome.styles';

const MyHome = () => {
	const dataCorona = useSelector(selectDataCorona);
	const isFetching = useSelector(selectIsFetching);
	const countriesHarsh = dataCorona.reduce((map, obj) => {
		map[obj.name.replace(/\s+/g, '').toLowerCase()] = { ...obj };
		return map;
	}, {});
	const vietNam = countriesHarsh['vietnam'];
	const us = countriesHarsh['us'];
	console.log(vietNam);
	return isFetching ? (
		<div />
	) : (
		<HomeContainer>
			<TableContainer>
				<CountryContainer />
				<WrapContainer>
					<NameContainer> Ca Nhiễm </NameContainer>
					<NumberContainer> {us.confirmed} </NumberContainer>
				</WrapContainer>
				{/* <NameContainer>Ca phục hồi </NameContainer>
				<NumberContainer>{vietNam.recovered} </NumberContainer>
				<NameContainer>Ca tử vong</NameContainer>
				<NumberContainer>{vietNam.deaths} </NumberContainer> */}
			</TableContainer>
		</HomeContainer>
	);
};

export default MyHome;
